import React from "react";
class Jaki extends React.Component{
    constructor(){
        super();
        this.state={
            fname:"",
            Email:"",
            password:"",
            cpassword:""
        }
    }
    handleFname=(e)=>{
        this.setState({fname:e.target.value})
    }
    handleEmail=(e)=>{
        this.setState({Email:e.target.value})
    }
    handlePassword=(e)=>{
        this.setState({password:e.target.value})
    }
    handleCpassword=(e)=>{
        this.setState({cpassword:e.target.value})
    }

    render(){
        return(
            <di>
                <label>Fname:</label>
                <input value={this.state.fname} type="text"  required ></input>
                <br></br><br></br>
                <label >Email:</label>
                <input value={this.state.Email}  type="email"  required></input>
                <br></br><br></br>
                <label>password:</label>
                <input value={this.state.password}  type="password" required></input>
                <br></br><br></br>
                <label>cpassword:</label>
                <input  value={this.state.cpassword} type="Cpassword"required></input>
                <br></br><br></br>
            </di>
          
        )
    }
}
export default Jaki;
